import { Component, useState } from "react";
import { useDispatch, useSelector } from "react-redux"
import TodoSubList from './todosublist'

const ShowListItem = () => {
    const selector = useSelector(state => state)
    if (Object.keys(selector).length >= 1) {
        console.log("inside showItem", selector)
        console.log("using selector len", Object.keys(selector))

        let mapper =
            Object.keys(selector).map(input =>

                <div className="holder">
                    {console.log("input", selector[input])}

                    <div className="container">
                        <div className="item2">{selector[input.task]}<button type='button' >Clickhere</button></div>
                        <div className="item2">{input.dateE}</div>
                        <div className="item2">{input.dateB}</div>
                        <div className="item2">{input.completed}</div>

                    </div>
                    {console.log("input.date", input.dateB)}
                    <div>{(input.steps.length > 0 && input.show) && TodoSubList(input.steps)}
                    </div>
                </div>
            )
        return mapper
    }
    return null
}

export default ShowListItem
